                left.simpleBag = _simpleBagHandler.join(left.simpleBag, right.simpleBag);
                left.simpleBag2 = _simpleBag2Joiner.join(left.simpleBag2, right.simpleBag2);
                left.bagMap = _bagMapJoiner.join(left.bagMap, right.bagMap);
